import {Component} from "react";
import Clock from "./Clock";

class NamazTimes extends Component {
    render() {
        let post = []
        let namazT = [5, 14, 16, 17, 20]
        let namazN = ["faz", "duh", "asr", "mgr", "esh"]
        for (let i = 0; i < 24; i++) post.push(<li></li>);
        let NNIndex = 0;
        namazT.forEach(it => {
            post[it - 1] = <li><b>{namazN[NNIndex]}</b> {it > 12 ? (it - 12) + ":00" : it + ":00"}<apm>{it>12?"pm": "am"}</apm>
            </li>;

            NNIndex++; });

        return post
    }
}
export default NamazTimes
